import React from "react";

export default function ChangeThemeButton({ onClick, image }) {
  const source = "url(" + image + ")";

  return (
    <input
      type='image'
      alt='change theme button'
      className='change-theme-btn'
      onClick={onClick}
      src={source}
    />
  );
}
